export enum CourseDisplay {
  Desktop = "desktop",
  Smartphone = "smartphone",
  FullResponsive = "fullresponsive",
}

export enum CourseExportTypes {
  LMS = "lms",
  Web = "web",
  Translation = "translation",
}

export enum CourseExportPrerequisite {
  Default = "default",
  Noprerequisite = "no prerequisite",
}

export enum CourseExportOrientation {
  Free = "free",
  Portrait = "portrait only",
  Landscape = "landscape only",
}

